import React from 'react';
import './App.css';

class App extends React.Component {

state = {
  users: [
    {
      name: "David", 
      city: "Cornwall"
    },
    {
      name: "Peter",
      city: "Reading"
    }
  ]
}

  render(){
    const allUsers = this.state.users.map( (object) => {
      return <h1>My Name is {object.name} and im from {object.city}</h1>
    })


    return(
      <div>
        {allUsers}

      </div>

    );
  }
}



export default App;
